webpackJsonp([0xc02266868149],{470:function(t,a){t.exports={data:{markdownRemark:{html:'<p>The Directory is a community-curated resource for contacting security teams. It identifies the best way to contact an organization\'s security team so that all hackers can report potential vulnerabilities directly to the organizations that can resolve them. The directory is comprised of a list of various organizations that both use and don\'t use HackerOne. It documents the existence of an organization\'s vulnerability disclosure policy and any associated bug bounty programs.</p>\n<p>As HackerOne believes that all organizations who build technology should provide a safe process for vulnerability disclosure, the HackerOne Directory aids in providing a safer internet as it provides hackers with the ability to contact an organization with their found vulnerabilities.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/directory-6-fb3f84af80f76b3bf361bab96ab1327e-b4ffb.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 60.08146639511202%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="directory-6"\n        title=""\n        src="/static/directory-6-fb3f84af80f76b3bf361bab96ab1327e-e7ffa.png"\n        srcset="/static/directory-6-fb3f84af80f76b3bf361bab96ab1327e-49813.png 125w,\n/static/directory-6-fb3f84af80f76b3bf361bab96ab1327e-dc8a5.png 250w,\n/static/directory-6-fb3f84af80f76b3bf361bab96ab1327e-e7ffa.png 500w,\n/static/directory-6-fb3f84af80f76b3bf361bab96ab1327e-dda24.png 750w,\n/static/directory-6-fb3f84af80f76b3bf361bab96ab1327e-c5f18.png 1000w,\n/static/directory-6-fb3f84af80f76b3bf361bab96ab1327e-22484.png 1500w,\n/static/directory-6-fb3f84af80f76b3bf361bab96ab1327e-b4ffb.png 1964w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Directory Services</h3>\n<p>The Directory enables Hackers to:</p>\n<ul>\n<li>Share their disclosure experiences and add security team contact information to the Directory so others can benefit from their work.</li>\n<li><a href="https://hackerone.com/directory">Search the Directory</a> to get the contact information for an organization\'s security team.</li>\n<li>Find programs they\'re interested to hack on.</li>\n</ul>\n<p><em>Note: If an organization hasn\'t published security contact information anywhere, HackerOne recommends considering assistance from the <a href="https://www.first.org/members/teams/">local CERT</a>.</em></p>\n<p>The Directory enables programs to:</p>\n<ul>\n<li>Publish contact information for receiving information about potential vulnerabilities in their products or online services, such as a security@ email address or a HackerOne program. See <a href="http://www.iso.org/iso/catalogue_detail.htm?csnumber=45170">ISO 29147</a> for additional guidance or <a href="mailto:support@hackerone.com">contact HackerOne</a>.</li>\n<li><a href="https://hackerone.com/directory">Search the Directory</a> for their organization to ensure that their security team\'s contact information and disclosure policy is accurate. </li>\n</ul>\n<h3>What\'s on the Directory</h3>\n<p>You can find this information associated with an organization on the directory:</p>\n<table>\n<thead>\n<tr>\n<th>Option</th>\n<th>Detail</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Bugs Resolved</td>\n<td>The total number of vulnerabilities the organization has resolved. If the field is marked with a \n<code>-</code>\n this means that there are no resolved reports, or the program chose not to display this information on their metric display settings.</td>\n</tr>\n<tr>\n<td>Minimum Bounty</td>\n<td>The minimum bounty that will be given for a valid vulnerability. If the field is marked with a \n<code>-</code>\n this means that there is no minimum bounty, or the program chose not to display this information on their metric display settings.</td>\n</tr>\n</tbody>\n</table>\n<p>As the directory contains various icons, refer to this table to understand the different icons associated with an organization:</p>\n<table>\n<thead>\n<tr>\n<th>Icon</th>\n<th>Detail</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>IBB \n<br>\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/directory-3-f5ab5dd8f246950dc87abd908c3a5c4c-7dbcd.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 79px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 58.22784810126582%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="directory-3"\n        title=""\n        src="/static/directory-3-f5ab5dd8f246950dc87abd908c3a5c4c-7dbcd.png"\n        srcset="/static/directory-3-f5ab5dd8f246950dc87abd908c3a5c4c-07792.png 125w,\n/static/directory-3-f5ab5dd8f246950dc87abd908c3a5c4c-7dbcd.png 158w"\n        sizes="(max-width: 79px) 100vw, 79px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </td>\n<td>Indicates Internet Bug Bounty - a bug bounty program for core internet infrastructure and free open source software. These programs are managed by a panel of volunteers selected from the security community. Learn more \n<a href="https://www.hackerone.com/internet-bug-bounty">here</a>\n.</td>\n</tr>\n<tr>\n<td>Managed \n<br>\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/directory-4-a3b8651a0833db29e1b632dc53a90cf1-b77e7.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 120px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 33.33333333333333%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="directory-4"\n        title=""\n        src="/static/directory-4-a3b8651a0833db29e1b632dc53a90cf1-b77e7.png"\n        srcset="/static/directory-4-a3b8651a0833db29e1b632dc53a90cf1-7f866.png 125w,\n/static/directory-4-a3b8651a0833db29e1b632dc53a90cf1-b77e7.png 240w"\n        sizes="(max-width: 120px) 100vw, 120px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n</br></td>\n<td>A program that is managed by HackerOne. These programs are more likely to respond quickly to your report and there\'s a higher likelihood of being successful on these programs because it\'s managed by the HackerOne triage team.</td>\n</tr>\n<tr>\n<td>Not accepting submissions \n<br>\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/directory-5-486a979e6751b8637f7230d5ba22f510-ab95f.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 331px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 14.199395770392748%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="directory-5"\n        title=""\n        src="/static/directory-5-486a979e6751b8637f7230d5ba22f510-4cfcf.png"\n        srcset="/static/directory-5-486a979e6751b8637f7230d5ba22f510-fe182.png 125w,\n/static/directory-5-486a979e6751b8637f7230d5ba22f510-35683.png 250w,\n/static/directory-5-486a979e6751b8637f7230d5ba22f510-4cfcf.png 500w,\n/static/directory-5-486a979e6751b8637f7230d5ba22f510-ab95f.png 662w"\n        sizes="(max-width: 331px) 100vw, 331px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </td>\n<td>A program that isn\'t accepting any report submissions on HackerOne.</td>\n</tr>\n<tr>\n<td>Pink thunderbolt \n<br>\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/directory-2-c6af50a76e769fa833d4bb1c945ab78e-a8a3a.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 59px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 89.83050847457628%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="directory-2"\n        title=""\n        src="/static/directory-2-c6af50a76e769fa833d4bb1c945ab78e-a8a3a.png"\n        srcset="/static/directory-2-c6af50a76e769fa833d4bb1c945ab78e-a8a3a.png 118w"\n        sizes="(max-width: 59px) 100vw, 59px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n</br></td>\n<td>The program responds quickly to report submissions. There\'s a &#x3C;48 hour first response time.</td>\n</tr>\n<tr>\n<td>Purple and pink thunderbolt \n<br>\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/directory-1-7d076f06b9abae5169fcc69311493966-9f545.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 55px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 98.18181818181817%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="directory-1"\n        title=""\n        src="/static/directory-1-7d076f06b9abae5169fcc69311493966-9f545.png"\n        srcset="/static/directory-1-7d076f06b9abae5169fcc69311493966-9f545.png 110w"\n        sizes="(max-width: 55px) 100vw, 55px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n</br></td>\n<td>The program responds quickly to report submissions and is also quick in awarding bounties. There\'s a &#x3C;48 hour first response time and a &#x3C;14 day time in awarding a bounty.</td>\n</tr>\n</tbody>\n</table>\n<h3>Using the Directory</h3>\n<p>You can search for organizations in the directory by searching for them in the search bar. You can also filter organizations by asset type and sort them by: </p>\n<ul>\n<li>Newest</li>\n<li>Oldest</li>\n<li>Bounty Amount</li>\n<li>Number of bugs resolved</li>\n<li>Alphabetized name</li>\n</ul>\n<h3>Correcting Information on the Directory</h3>\n<p>As the directory is community-curated, hackers who maintain sufficient reputation have edit rights and can update information about an organization, or you can reach a moderator at directory@hackerone.com with any changes. </p>',frontmatter:{title:"Directory",id:"hackers/directory",path:"/hackers/directory.html",description:null}}},pathContext:{}}}});
